        <div>
          <h1 className="font-bold text-white text-4xl" style={{ fontFamily: 'era', textAlign: 'center' }}>TAYLOR SWIFT: THE ERAS TOUR TRACKER</h1>
		  <h1 className="text-white text-xl" style={{ fontFamily: 'debut', textAlign: 'center' }}>You can click on the map markers to see the dates and stadiums for shows!</h1>
        </div>
      </div>
	</div>

  )}
